import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./navbar.css";
import { useAuth0 } from "../react-auth0-spa";
import { Link } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";

const NavBar = () => {
  const { isAuthenticated, loginWithRedirect, logout } = useAuth0();

  return (
    <div>
      {!isAuthenticated && (
        <Navbar bg="light fixed-top" expand="lg">
          <Navbar.Brand href="">Resource Center</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            <Button style={{ marginLeft: "5px" }} variant="outline-success">
              <Nav.Link href="/home">Home</Nav.Link>
              </Button>
              {/* <Nav.Link href="#link">Link</Nav.Link> */}
              <Button style={{ marginLeft: "5px" }} variant="outline-success">
                <NavDropdown title="Topics" id="basic-nav-dropdown">
                  {/* <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item> */}
                  <NavDropdown.Item href="#action/3.2">
                    {/* <li><Link to="/home">Home</Link></li> */}
                    {/* <li><Link to="/intro">Introduction</Link></li> */}
                    <li>
                      <Link to="/vsc">Visual Studio Code</Link>
                    </li>
                    <li>
                      <Link to="/gitbash">GitBash</Link>
                    </li>
                    <li>
                      <Link to="/IntroHTML">HTML</Link>
                    </li>
                    <li>
                      <Link to="/css">CSS</Link>
                    </li>
                    <li>
                      <Link to="/Bootstrap">BOOTSTRAP</Link>
                    </li>
                    <li>
                      <Link to="/javascript">JAVASCRIPT</Link>
                    </li>
                    <li>
                      <Link to="/jQuery">jQuery</Link>
                    </li>
                    <li>
                      <Link to="/react">React</Link>
                    </li>
                    <li>
                      <Link to="/ajax">Ajax</Link>
                    </li>
                    <li>
                      <Link to="/firebase">Firebase</Link>
                    </li>
                    <li>
                      <Link to="/Node.js">Node.js</Link>
                    </li>
                    <li>
                      <Link to="/mysql">MySQL</Link>
                    </li>
                    <li>
                      <Link to="/sequelize">Sequelize</Link>
                    </li>
                    <li>
                      <Link to="/profile">Profile</Link>
                    </li>
                  </NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.3">
                    {/* dropdown action link */}
                  </NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item href="#action/3.4">
                    Separated link
                  </NavDropdown.Item>
                </NavDropdown>
              </Button>
            </Nav>
            <Form inline>
              <FormControl
                type="text"
                placeholder="Search"
                className="mr-sm-2"
              />
              <Button variant="outline-success">Search</Button>
              <Button
                style={{ marginLeft: "5px" }}
                variant="outline-success"
                onClick={() => loginWithRedirect({})}
              >
                Log in
              </Button>
            </Form>
          </Navbar.Collapse>
        </Navbar>
      )}

      {isAuthenticated && (
        <Navbar bg="light fixed-top" expand="lg">
          <Navbar.Brand href="">Resource Center</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            <Button style={{ marginLeft: "5px" }} variant="outline-success">
              <Nav.Link href="/home">Home</Nav.Link>
              </Button>
              {/* <Nav.Link href="#link">Link</Nav.Link> */}
              <NavDropdown title="Topics" id="basic-nav-dropdown">
                {/* <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item> */}
                <NavDropdown.Item href="#action/3.2">
                  {/* <li><Link to="/home">Home</Link></li> */}
                  {/* <li><Link to="/intro">Introduction</Link></li> */}
                  <li>
                    <Link to="/vsc">Visual Studio Code</Link>
                  </li>
                  <li>
                    <Link to="/gitbash">GitBash</Link>
                  </li>
                  <li>
                    <Link to="/IntroHTML">HTML</Link>
                  </li>
                  <li>
                    <Link to="/css">CSS</Link>
                  </li>
                  <li>
                    <Link to="/Bootstrap">BOOTSTRAP</Link>
                  </li>
                  <li>
                    <Link to="/javascript">JAVASCRIPT</Link>
                  </li>
                  <li>
                    <Link to="/jQuery">jQuery</Link>
                  </li>
                  <li>
                    <Link to="/react">React</Link>
                  </li>
                  <li>
                    <Link to="/ajax">Ajax</Link>
                  </li>
                  <li>
                    <Link to="/firebase">Firebase</Link>
                  </li>
                  <li>
                    <Link to="/Node.js">Node.js</Link>
                  </li>
                  <li>
                    <Link to="/mysql">MySQL</Link>
                  </li>
                  <li>
                    <Link to="/sequelize">Sequelize</Link>
                  </li>
                  <li>
                    <Link to="/profile">Profile</Link>
                  </li>
                </NavDropdown.Item>
                {/* <NavDropdown.Item href="#action/3.3">
                  Something
                </NavDropdown.Item> */}
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>

            <Form inline>
              <FormControl
                type="text"
                placeholder="Search"
                className="mr-sm-2"
              />
              <Button variant="outline-success">Search</Button>
              <Button
                variant="outline-success"
                style={{ marginLeft: "5px" }}
                onClick={() => logout()}
              >
                Log out
              </Button>
            </Form>
          </Navbar.Collapse>
        </Navbar>
      )}
    </div>
  );
};

export default NavBar;

